import React, { useState } from "react";
import {
  Box,
  Grid,
  Text,
  Flex,
  Accordion,
  Center,
  Avatar,
  Badge,
  Checkbox,
  Button,
  ColorPicker,
  Input,
  Stack,
  Image,
  Card,
  Slider,
  ActionIcon,
} from "@mantine/core";
import {
  IconPlus,
  IconX,
  IconColumns1,
  IconBold,
  IconUnderline,
  IconItalic,
  IconLetterN,
} from "@tabler/icons-react";

const CustomizeCategory = () => {
  
  return (
    <>
      <Accordion.Item value="type">
        <Accordion.Control bg="#FFFFFF">Type</Accordion.Control>
        <Accordion.Panel bg="#FFFFFF">
          <ActionIcon variant="filled" color="indigo" w={150} h={50}>
            <IconColumns1
              style={{ width: "100%", height: "100%" }}
              stroke={1}
            />
            <IconColumns1
              style={{ width: "100%", height: "100%" }}
              stroke={1}
            />
            <IconColumns1
              style={{ width: "100%", height: "100%" }}
              stroke={1}
            />
          </ActionIcon>

          <ActionIcon variant="default" color="indigo" w={100} h={50} ml="xs">
            <IconColumns1
              style={{ width: "100%", height: "100%" }}
              stroke={1}
            />
            <IconColumns1
              style={{ width: "100%", height: "100%" }}
              stroke={1}
            />
          </ActionIcon>

          <ActionIcon variant="default" color="indigo" w={50} h={50} ml="xs">
            <IconColumns1
              style={{ width: "100%", height: "100%" }}
              stroke={1}
            />
          </ActionIcon>

          <ActionIcon variant="default" color="indigo" w={150} h={100}>
            <Stack w={`100%`} gap={0}>
              <Flex>
                <IconColumns1
                  style={{ width: "100%", height: "100%" }}
                  stroke={1}
                />
                <IconColumns1
                  style={{ width: "100%", height: "100%" }}
                  stroke={1}
                />
                <IconColumns1
                  style={{ width: "100%", height: "100%" }}
                  stroke={1}
                />
              </Flex>
              <Flex>
                <IconColumns1
                  style={{ width: "100%", height: "100%" }}
                  stroke={1}
                />
                <IconColumns1
                  style={{ width: "100%", height: "100%" }}
                  stroke={1}
                />
                <IconColumns1
                  style={{ width: "100%", height: "100%" }}
                  stroke={1}
                />
              </Flex>
            </Stack>
          </ActionIcon>

          <ActionIcon variant="default" color="indigo" w={100} h={100} ml="xs">
            <Stack w={`100%`} gap={0}>
              <Flex>
                <IconColumns1
                  style={{ width: "100%", height: "100%" }}
                  stroke={1}
                />
                <IconColumns1
                  style={{ width: "100%", height: "100%" }}
                  stroke={1}
                />
              </Flex>
              <Flex>
                <IconColumns1
                  style={{ width: "100%", height: "100%" }}
                  stroke={1}
                />
                <IconColumns1
                  style={{ width: "100%", height: "100%" }}
                  stroke={1}
                />
              </Flex>
            </Stack>
          </ActionIcon>

          <ActionIcon variant="default" color="indigo" w={50} h={100} ml="xs">
            <Stack w={`100%`} gap={0}>
              <Flex>
                <IconColumns1
                  style={{ width: "100%", height: "100%" }}
                  stroke={1}
                />
              </Flex>
              <Flex>
                <IconColumns1
                  style={{ width: "100%", height: "100%" }}
                  stroke={1}
                />
              </Flex>
            </Stack>
          </ActionIcon>
        </Accordion.Panel>
      </Accordion.Item>

      <Accordion.Item value="cart-options">
        <Accordion.Control bg="#FFFFFF">Cart Options</Accordion.Control>
        <Accordion.Panel bg="#FFFFFF">
          <Flex direction="column">
            <Text>Background Color</Text>
            <ColorPicker w="auto" size="lg" format="rgba" />
          </Flex>

          {/* Box Radius */}
          <Stack gap={0}>
            <Text>Box Radius</Text>
            <Flex
              mih={50}
              bg="white"
              gap="md"
              justify="center"
              align="center"
              direction="row"
              wrap="wrap"
              style={{
                border: "1px solid #1b1c1b",
                borderRadius: "5px",
              }}
            >
              <Input
                type="number"
                w={45}
                size="xs"
                readOnly
                style={{ borderRadius: "20px" }}
              />
              <Slider my="xs" min={0} max={100} w={200} label={null} />
              <IconPlus
                style={{
                  border: "1px solid #000",
                  borderRadius: "50%",
                  cursor: "pointer",
                }}
              />
            </Flex>
          </Stack>
        </Accordion.Panel>
      </Accordion.Item>
    </>
  );
};

export default CustomizeCategory;
